fn print_type_of<T>(_: &T) {
    println!("{}", std::any::type_name::<T>());
}

trait Extractor {
    fn peek_first(&mut self) -> Option<char>;
}

impl <'a> Extractor for std::str::Chars<'a> {
    fn peek_first(&mut self) -> Option<char> {
        print_type_of(self);
        let mut pk = self.peekable();
        print_type_of(&pk);
        pk.peek().and_then(|c| Some(*c))
    }
}

