struct Solution {}

impl Solution {
    pub fn count_homogenous(s: String) -> i32 {
        let mut res = 0;
        let mut iter = s.chars().peekable();
        loop {
            let to_add = Self::count_continuous(&mut iter); // max 100000
            if to_add == 0 { break res }
            let new_res = (to_add as u64 + 1) * (to_add as u64) / 2; // i32 mul overflows
            let new_res = (new_res % 1000000007) as i32;
            res = (res + new_res) % 1000000007;
        }
    }

    fn count_continuous(s: &mut std::iter::Peekable<std::str::Chars>) -> i32 {
        if let Some(c) = s.next() {
            let mut res = 1;
            while let Some(_) = s.next_if_eq(&c) { res += 1 }
            res
        } else {
            0
        }
    }
}

